import React, { Component } from 'react'
import { withStyles } from '@material-ui/core/styles';
import { connect } from 'react-redux'
import Button from '@material-ui/core/Button';
import DialogActions from '@material-ui/core/DialogActions';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Typography from '@material-ui/core/Typography';
import Checkbox from '@material-ui/core/Checkbox';
import { addSelectedPaymentObj, removeSelectedPaymentObj, submitEmailPaymentHistory } from '../../../../actions/payment-details-card.action';

class PaymentHistoryDialog extends Component {


    componentDidMount() {

    }
    handleSelectedPaymentHistory = (event, paymentHistoryObj) => {
        if (event.target.checked) {
            this.props.addSelectedPaymentObj(paymentHistoryObj);
        }
        else {
            this.props.removeSelectedPaymentObj(paymentHistoryObj);
        }
    };
    handlePaymentHistoryInvoiceSubmit = () => {
        this.props.submitEmailPaymentHistory();
    }

    render() {
        const { classes } = this.props;
        const { paymentDetailsCardDataResponse, selectedPaymentHistoryDetail } = this.props;
        const isEnableSubmitButton = selectedPaymentHistoryDetail && selectedPaymentHistoryDetail.length ? true : false;
        const paymentDetails = paymentDetailsCardDataResponse && paymentDetailsCardDataResponse.cardContent && paymentDetailsCardDataResponse.cardContent.paymentDetails;
        return (
            <div>
                <Table>
                    <TableHead>

                        <TableRow className="th-height">
                            <TableCell width="7%" className="table-cell-padding"><Typography component="h4"><strong></strong></Typography></TableCell>
                            <TableCell width="25%" className="table-cell-padding"><Typography component="h4"><strong>DATE</strong></Typography></TableCell>
                            <TableCell width="45%" className="table-cell-padding"><Typography component="h4"><strong>MODE</strong></Typography></TableCell>
                            <TableCell width="30%" className="table-cell-padding"><Typography component="h4"><strong>AMOUNT</strong> </Typography></TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>

                        {paymentDetails && paymentDetails.length && paymentDetails.map((item, index) => (
                            <TableRow key={index}>
                                <TableCell width="7%" className="table-cell-padding-inner ">
                                    <Checkbox classes={{
                                        root: classes.check,
                                        checked: classes.checked,
                                    }} onChange={event => this.handleSelectedPaymentHistory(event, item.trackingNumber)} />
                                </TableCell>
                                <TableCell width="25%" className="table-cell-padding-inner">
                                    {item['paymentPostedDate']}
                                </TableCell>
                                <TableCell width="45%" className="table-cell-padding-inner">
                                    {item['paymentRemarks']}
                                </TableCell>
                                <TableCell width="30%" className="table-cell-padding-inner">
                                    {item['amount']}
                                </TableCell>
                            </TableRow>

                        ))}


                    </TableBody>
                </Table>
                <DialogActions className="custom-blue-button ml-25 mr-25 mt-25 mb-25">
                    <Button type="submit" value="Submit" variant="contained" size="large" disabled={!isEnableSubmitButton} className="color-white" onClick={this.handlePaymentHistoryInvoiceSubmit} >SEND RECEIPT</Button>
                </DialogActions>
            </div>
        )
    }
}
const mapDispatchToProps = dispatch => ({
    addSelectedPaymentObj: selectedPaymentHistoryObj => dispatch(addSelectedPaymentObj(selectedPaymentHistoryObj)),
    removeSelectedPaymentObj: selectedPaymentHistoryObj => dispatch(removeSelectedPaymentObj(selectedPaymentHistoryObj)),
    submitEmailPaymentHistory: data => dispatch(submitEmailPaymentHistory(data))
});
const mapStateToProps = state => {
    return {
        paymentDetailsCardDataResponse: state.PaymentDetailsCardData.PaymentDetailsCardDataResponse,
        selectedPaymentHistoryDetail: state.PaymentDetailsCardData.selectedPaymentHistoryDetail,
    }
}

const styles = theme => ({
    checked: {
        color: '#00a9f4 !important'
    }
});
export default connect(mapStateToProps, mapDispatchToProps)(withStyles(styles)(PaymentHistoryDialog));
